import logo from './logo.svg';
import pokeball from './Pokeball-icon.svg' ;

let myName = 'Anthony';
if (myName !== true) {
  myName = '...err...uuummm... hmm I don\'t know ';
};

//Function HTML section
function Content02() {
  return (
    <div 
      id="startSection02"
      className="Main-Content" 
      style={{fontWeight:"500", height:"100vh"}}
      data-aos="fade-right"
      data-aos-anchor-placement="top-center"
      data-aos-duration="1000"
      // data-aos-offset="0"
    >
      <img src={logo} className="App-logo-small" alt="logo" />
    <div>
      <span>My name is {myName}</span>
      <img src={pokeball} className="pokeball" alt="pokeball" style={{position:"relative", left:"47%", top:"10px", scale:"1"}} />
      </div>
    </div>
  );
}

export default Content02;
